import C from '../../actions/constants';
var jp = require('jsonpath')

const initialState = {
    getUserEvent: []
}



export default (state = initialState, action)=> {
    switch (action.type) {
        case C.GET_CONTRIBUTION_LIST:
            debugger;
            console.log(action.payload.responseData)
            return {
                getUserEvent: action.payload.responseData



            }
        case C.CLEAR_USER_EVENT:
            return {
                ...initialState
            }
        default:
            return {
                ...state
            }
    }
}
